function PMC_JCaptcha(){this.range_outer=20,this.use_single_op=!1,this.answer=0}PMC_JCaptcha.prototype.get_random_number=function(t){return("undefined"==typeof t||parseInt(t)<1)&&(t=this.range_outer),Math.floor(Math.random()*parseInt(t)+1)},PMC_JCaptcha.prototype.get_operator=function(){var t=this.get_random_number(100),e=parseInt(t%2);switch(this.use_single_op&&(e=1),e){case 0:return"*";case 1:return"+"}},PMC_JCaptcha.prototype.get_question=function(){var num_1=this.get_random_number(),num_2=this.get_random_number(10),op=this.get_operator(),question=num_1+" "+op+" "+num_2;return this.answer=parseInt(eval(question)),question},PMC_JCaptcha.prototype.is_answer=function(t){return"undefined"!=typeof t&&parseInt(t)===parseInt(this.answer)?!0:!1};var pmc_jcaptcha=new PMC_JCaptcha;